import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router, ActivatedRoute } from '@angular/router';

//SERVICE

import { OrdenesService } from "../../service/ordenes/ordenes.service";
import { VtPinturaService } from "../../service/data-informes/vt-pintura.service";

import Swal from 'sweetalert2';

@Component({
  selector: 'app-vt-pintura',
  templateUrl: './vt-pintura.component.html',
  styleUrls: ['./vt-pintura.component.css']
})
export class VtPinturaComponent implements OnInit {

  actividades: any = [
    'Preparación de la superficie.',
    'Calificación del personal.',
    'Comprensión de las epecificaciones del proyecto.',
    'Comprensión de la ficha técnica del fabricante.',
    'Condiciones ambientales.',
    'Pintura y color especificados.',
    ' Equipo de calefacción y/ó deshumidificacion.']

  isLinear = true;
  normasCriterio !: FormGroup;
  PrevioPintura !: FormGroup;

  normasCriterioId: any
  normasCriterioBtnSave: boolean = true
  implementosUtilizados: any = []


  actividadesCalificacion: any = []

  constructor(private _formBuilder: FormBuilder, private _route: Router,
    private _activatedRoute: ActivatedRoute, private _ordenesService: OrdenesService,
    private _vtPinturaService: VtPinturaService
  ) { }

  ngOnInit(): void {
    this.forms()
  }

  forms() {
    this.normasCriterio = this._formBuilder.group({
      equipos: ['', [Validators.required]],
      material_base: ['', Validators.required],
      aplicacion: ['', Validators.required],
      acond_Superficie: ['', Validators.required],
      anticorrosivo: ['', Validators.required],
      intermedia: ['', Validators.required],
      acabado: ['', Validators.required],
    });
    this.PrevioPintura = this._formBuilder.group({
      actividad: ['', Validators.required],
      calificacion1: ['', Validators.required],
      calificacion2: ['', Validators.required],
      Observaciones: ['', Validators.required]
    });
  }

  onGetImplementos() {
    this._activatedRoute.params.subscribe(params => {
      const orden_id = params['orden_id'];

      this._ordenesService.getImplementosOrdenes(orden_id).subscribe((res) => {

        this.implementosUtilizados = res.body
      })

    })
  }

  onGetResumenEditNormasCriterio() {

    this._activatedRoute.params.subscribe(params => {

      const orden_id = params['orden_id'];

      const informe_id = params['informe_id'];

      this._vtPinturaService.getNormasCriterioVtPintura(orden_id, informe_id).subscribe((res) => {

        this.normasCriterioId = res.body._id

        this.normasCriterio.patchValue(res.body)

        this.normasCriterioBtnSave = false


        console.log(this.normasCriterioId)
      }, error => {

        var errorMessage = <any>error;

        if (errorMessage != null) {
          var body = error.error

          if (error.status === 500) {

            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px'
            })

            Toast.fire({
              icon: 'error',
              title: body.message

            })

          } else if (error.status === 0) {

            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px'
            })

            Toast.fire({
              icon: 'error',
              title: 'Por favor compruebe su conexión de internet'

            })

          }
        }
      })
    })
  }

  onSubmitOrEditNormasCriterio() {

    if (this.normasCriterioId) {
      let data = { ...this.normasCriterio.value, _id: this.normasCriterioId }

      this._vtPinturaService.putNormasCriterioVtPintura(data).subscribe((res) => {

        this.onGetResumenEditNormasCriterio()

      }, error => {

        var errorMessage = <any>error;

        if (errorMessage != null) {
          var body = error.error

          if (error.status === 401) {
            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px'
            })

            Toast.fire({
              icon: 'info',
              title: 'No hay usuarios por favor Agregue uno'
            })
          } else if (error.status === 500) {

            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px'
            })

            Toast.fire({
              icon: 'error',
              title: body.message

            })

          } else if (error.status === 0) {

            const Toast = Swal.mixin({
              toast: true,
              position: 'center',
              showConfirmButton: false,
              timer: 4000,
              timerProgressBar: true,
              width: '300px'
            })

            Toast.fire({
              icon: 'error',
              title: 'Por favor compruebe su conexión de internet'

            })

          }
        }
      })
    } else {
      this._activatedRoute.params.subscribe(params => {

        const orden_id = params['orden_id'];

        const informe_id = params['informe_id'];

        let data = { ...this.normasCriterio.value, orden_id, informe_id }

        this._vtPinturaService.postNormasCriterioVtPintura(data).subscribe((res) => {

        }, error => {

          var errorMessage = <any>error;

          if (errorMessage != null) {
            var body = error.error

            if (error.status === 401) {
              const Toast = Swal.mixin({
                toast: true,
                position: 'center',
                showConfirmButton: false,
                timer: 4000,
                timerProgressBar: true,
                width: '300px'
              })

              Toast.fire({
                icon: 'info',
                title: 'No hay usuarios por favor Agregue uno'
              })
            } else if (error.status === 500) {

              const Toast = Swal.mixin({
                toast: true,
                position: 'center',
                showConfirmButton: false,
                timer: 4000,
                timerProgressBar: true,
                width: '300px'
              })

              Toast.fire({
                icon: 'error',
                title: body.message

              })

            } else if (error.status === 0) {

              const Toast = Swal.mixin({
                toast: true,
                position: 'center',
                showConfirmButton: false,
                timer: 4000,
                timerProgressBar: true,
                width: '300px'
              })

              Toast.fire({
                icon: 'error',
                title: 'Por favor compruebe su conexión de internet'

              })

            }
          }
        })
      })
    }
  }

  async onAddPrevioPintura() {

    if (this.PrevioPintura.status === 'INVALID') {

    } else {
      this.actividades.splice(this.PrevioPintura.value.actividad, 1);

      this.actividadesCalificacion.push(this.PrevioPintura.value)

      this.PrevioPintura.reset()
    }

  }

  onClickEditPrevioPintura(data : any){

    console.log(data)

  }
}
<div class="flex items-start justify-between">
  <div class="grid grid-cols-2 gap-x-4 gap-y-1">
    <div class="text-4xl tracking-tight text-secondary">Proyecto</div>
    <div class="text-4xl"></div>
    <div class="font-medium tracking-tight text-secondary">Sub-proyecto</div>
    <div class="font-medium"></div>
    <div class="font-medium tracking-tight text-secondary">Consecutivo</div>
    <div class="font-medium"></div>
    <div class="font-medium tracking-tight text-secondary">Fecha de inicio</div>
    <div class="font-medium"></div>
    <div class="font-medium tracking-tight text-secondary">Lugar de inspección</div>
    <div class="font-medium"></div>
  </div>
</div>

<div class="projects-section-header">
  <div class="flex sm items-start sm:items-center sm:justify-between py-8 px-6 px-8">
    <div>
      <div class="text-3xl font-extrabold tracking-tight leading-none">Inspección visual de pintura</div>
      <div class="ml-0.5 font-medium text-secondary">

      </div>
    </div>
    <div class="mt-4 sm:mt-0">
      <!----><button mat-flat-button (click)="onGetImplementos(); onGetResumenEditNormasCriterio()"
        class="mat-focus-indicator mat-tooltip-trigger ml-3 mat-flat-button mat-button-base btn btn-primary"
        type="button" data-bs-toggle="modal" data-bs-target="#exampleModal"><span class="mat-button-wrapper">
          <mat-icon role="img" class="mat-icon notranslate mat-icon-no-color" aria-hidden="true"
            data-mat-icon-type="svg" data-mat-icon-name="plus" data-mat-icon-namespace="heroicons_outline"><svg
              xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" fit=""
              height="100%" width="100%" preserveAspectRatio="xMidYMid meet" focusable="false">
              <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 6v6m0 0v6m0-6h6m-6 0H6">
              </path>
            </svg></mat-icon><span class="ml-2 mr-1">Agregar inspección</span>
        </span><span matripple="" class="mat-ripple mat-button-ripple"></span><span
          class="mat-button-focus-overlay"></span></button>
      <!---->
    </div>
  </div>
</div>



<div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div class="modal-dialog modal-fullscreen">
    <div class="modal-content">
      <div class="modal-header">
        <h5 class="modal-title" id="exampleModalLabel">Agregar inspección</h5>
        <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
      </div>
      <div class="modal-body">

        <form class="p-4 bg-card shadow rounded overflow-hidden" [formGroup]="normasCriterio">
          <mat-stepper [linear]="isLinear" #stepper>
            <mat-step [stepControl]="normasCriterio">
              <form [formGroup]="normasCriterio" (ngSubmit)="onSubmitOrEditNormasCriterio()">
                <ng-template matStepLabel>Normas para el criterio de evaluación</ng-template>

                <div class="flex">
                  <mat-form-field class="flex-auto" appearance="outline">
                    <mat-label>Seleccione los equipos utilizados</mat-label>
                    <mat-select [formControlName]="'equipos'" multiple>
                      <mat-option *ngFor="let implementoItem of implementosUtilizados"
                        [value]="implementoItem.nombre_implemento">{{implementoItem.nombre_implemento}}</mat-option>
                    </mat-select>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>settings</mat-icon>
                  </mat-form-field>
                </div>

                <div class="flex">
                  <mat-form-field class="flex-auto" appearance="outline">
                    <input matInput [formControlName]="'material_base'" [placeholder]="'Material Base'"
                      autocomplete="off" required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>build</mat-icon>
                  </mat-form-field>
                </div>
                <div class="flex">
                  <mat-form-field class="flex-auto" appearance="outline">
                    <input matInput [formControlName]="'aplicacion'" [placeholder]="'Aplicación'" autocomplete="off"
                      required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>perm_data_setting</mat-icon>
                  </mat-form-field>
                </div>

                <p class="my-6 font-medium">Sistema de pintura: </p>

                <div class="content-inputs flex">
                  <mat-form-field class="flex-auto" appearance="outline">
                    <input matInput [formControlName]="'acond_Superficie'" [placeholder]="'Acond. Superficie'"
                      autocomplete="off" required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>picture_in_picture_alt</mat-icon>
                  </mat-form-field>

                  <mat-form-field class="flex-auto" appearance="outline">
                    <input matInput [formControlName]="'anticorrosivo'" [placeholder]="'Anticorrosivo'"
                      autocomplete="off" required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>build</mat-icon>
                  </mat-form-field>
                </div>

                <div class="content-inputs flex">
                  <mat-form-field class="flex-auto" appearance="outline">
                    <input matInput [formControlName]="'intermedia'" [placeholder]="'Intermedia'" autocomplete="off"
                      required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>settings_ethernet</mat-icon>
                  </mat-form-field>

                  <mat-form-field class="flex-auto" appearance="outline">
                    <input matInput [formControlName]="'acabado'" [placeholder]="'Acabado'" autocomplete="off" required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>check_circle_outline</mat-icon>
                  </mat-form-field>
                </div>

                <div class="flex justify-end mt-8 ng-star-inserted">
                  <button type="submit" mat-button matStepperNext
                    [disabled]="normasCriterioBtnSave && normasCriterio.pristine || normasCriterio.invalid"
                    class="mat-focus-indicator mat-stepper-next px-8 mat-flat-button mat-button-base mat-primary next-save">
                    <span class="mat-button-wrapper"> Siguiente </span>
                    <span matripple class="mat-ripple mat-button-ripple"></span>
                    <span class="mat-button-focus-overlay"></span></button>
                </div>
              </form>
            </mat-step>
            <mat-step [stepControl]="PrevioPintura" label="Previo a la preparación y aplicación de pintura">
              <form [formGroup]="PrevioPintura">
                <div class="content-inputs flex">
                  <mat-form-field class="flex-auto" appearance="outline">

                    <mat-label>Seleccione una opción</mat-label>
                    <mat-select [formControlName]="'actividad'">
                      <mat-option *ngFor="let itemACtvidad of actividades" [value]="itemACtvidad">{{itemACtvidad}}
                      </mat-option>
                    </mat-select>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>picture_in_picture_alt</mat-icon>
                  </mat-form-field>

                  <mat-form-field class="flex-auto" appearance="outline">

                    <mat-label>Seleccione una opción</mat-label>
                    <mat-select [formControlName]="'calificacion1'">
                      <mat-option [value]="'A'">Aplica</mat-option>
                      <mat-option [value]="'N.A.'">No aplica</mat-option>
                      <mat-option [value]="'F.A.'">Fuera de Alcance</mat-option>
                    </mat-select>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>picture_in_picture_alt</mat-icon>
                  </mat-form-field>

                  <mat-form-field class="flex-auto" appearance="outline">
                    <mat-label>Seleccione una opción</mat-label>
                    <mat-select [formControlName]="'calificacion2'">
                      <mat-option [value]="'S'">Satisfactorio</mat-option>
                      <mat-option [value]="'N.S.'">No Satisfactorio</mat-option>
                    </mat-select>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>build</mat-icon>
                  </mat-form-field>

                  <mat-form-field class="flex-auto" appearance="outline">
                    <mat-label>Observaciones</mat-label>
                    <input matInput [formControlName]="'Observaciones'"
                      autocomplete="off" required>
                    <mat-icon class="icon-size-5 icon-form" matPrefix>class</mat-icon>
                  </mat-form-field>
                </div>

                <div class="flex justify-end">
                  <button type="submit"
                    class="mat-focus-indicator mat-stepper-next px-8 mat-flat-button mat-button-base  btn btn-success"
                    mat-flat-button type="button" (click)="onAddPrevioPintura()">
                    Añadir
                  </button>
                </div>
                <table class="table table-hover">
                  <tbody>
                    <tr *ngFor="let itemActividad of actividadesCalificacion">
                      <td> {{itemActividad.actividad}} </td>
                      <td>{{itemActividad.calificacion1}}</td>
                      <td>{{itemActividad.calificacion2}}</td>
                      <td>{{itemActividad.Observaciones}}</td>
                    </tr>
                  </tbody>
                </table>

                <div class="flex justify-end">
                  <button
                    class="mat-focus-indicator mat-stepper-next px-8 mat-flat-button mat-button-base mat-primary back mr-2"
                    mat-flat-button type="button" matStepperPrevious>
                    Atras
                  </button>
                  <button type="button"
                    class="mat-focus-indicator mat-stepper-next px-8 mat-flat-button mat-button-base mat-primary next-save"
                    mat-flat-button type="button" matStepperNext>
                    Siguiente
                  </button>
                </div>
              </form>
            </mat-step>
            <mat-step>
              <ng-template matStepLabel>Done</ng-template>
              <p>You are now done.</p>
              <div>
                <button mat-button matStepperPrevious>Back</button>
                <button mat-button (click)="stepper.reset()">Reset</button>
              </div>
            </mat-step>
          </mat-stepper>
        </form>

      </div>
    </div>
  </div>
</div>
